import './App.css';

import TextField from "./components/TextField"
import TextAreaField from "./components/TextAreaField"
import NumberField from "./components/NumberField"
import DateField from "./components/DateField"
import SelectField from "./components/SelectField"
import ButtonField from "./components/ButtonField"
import FlowBox from './components/FlowBox';

function App() {

  const options = [
    { value: 'option1', label: 'Option 1' },
    { value: 'option2', label: 'Option 2' },
    { value: 'option3', label: 'Option 3' },
  ];

  return (
    <div className="App">
     <TextField label="Name" name="name" id="nameid" styleClass="col2"/>
     <TextAreaField label="Name" name="name" id="nameid" styleClass="col2"/>
     <NumberField label="Name" name="name" id="nameid" styleClass="col2"/>
     <DateField label="Name" name="name" id="nameid" styleClass="col2"/>
     <SelectField label="Name" name="name" id="nameid" styleClass="col2" options={options}/> 
     <ButtonField value="val" id="nameid" styleClass="col2"/> 
    <FlowBox/>
    </div>
  );
}

export default App;
